#Global Constants
W = image_array[0].shape[0]
H = image_array[0].shape[1]
BINS = 100

"""The Images are Grayscale image. There are 4 values for every pixel as (GrayScale,GrayScale,GrayScale,Scale), eg. (35,35,35,255).
We only need one value so we are transforming the image and normalizing the value by dividing by max(255) so that each pixel ranges between 0 and 1
"""

#Image Transformation from 128*128*4 to 128*128
def image_transformation(image):
  img = np.zeros((H,W))
  for i in range(H):
    for j in range(W):
      img[i][j] = image[i][j][0]/255
  return img

"""The seeds in random walker are generally user-defined. To set them automatically, we choose the peak intensities, i.e. those intensities which occur the most in the image.

We define a peak as that value of intensity whose frequency(occurence) is maximum in its left and right neighbourhood of intensities and create a dictionary of (intensity,frequency_of_intensity). The logic behind this is that generally, different segments has different intensities and if it is a significant segment, its frequency will be high. This can be verified by plotting a histogram between the intensity(x-axis) and the frequency(y-axis)

This thing may change depending on the image as the peaks of the image do not always comply a different segment. There might be the case that a low peak is a more significant sgment and the higher two peaks comprises a single segment. There will always be a tradeoff betweeen something, as it depends on image.However, for general case, by choosing the peaks, the results of markers were pretty good and seems logical.

"""

#Function to check whether it is a peak or not 
#we check 5 right and 5 left entries on a histogram with a certain bin(set to 100) to specify peak
def is_peak(freq,ind):
  for i in range(ind-1,max(0,ind-6),-1):
    if(freq[ind] < freq[i]):
      return False
  for i in range(ind+1,min(ind+6,BINS),1):
    if(freq[ind] < freq[i]):
      return False
  return True

#return dictionary of (intensity_at_peak,frequency) values
def get_peaks(img):
  peak_intensities = {}
  counts,intensity =np.histogram(img.flat,BINS)
  #counts -> y-axis, intensity -> x-axis
  for i in range(BINS):
    if(is_peak(counts,i)):
      peak_intensities[intensity[i]]=counts[i]
  return peak_intensities

"""We set markers(1,2,3,etc.) for every pixel in the image whose intensity lies within 0.01 of the intensities at peaks and this gives us a seeds dictionary which shows the seeds as per the number of segments.The seeds with key 0 shows the unmarked pixels in the image.

The Marker image shows the differnt markers set for the image. The dark(black) region comprises of unmarked pixels(nodes)

The number of segments is user-defined, and we choose the minimum of the length of peaks_intensities and the segments, so that the number of segments do not go out of bound of the number of peaks.
"""

#return seeds (dictionary of marker_value and the indices of pixels in flatten img),
#markers set to 1,2,3,etc. as per the segments
#s: the number of segments used

def seeds_init(img,peaks,s):
  s=min(s,len(peaks))
  markers = np.zeros(img.shape, dtype=np.uint)
  for i in range(1,s+1):
    a=peaks[i-1][0]+0.01>img
    b=peaks[i-1][0]-0.01<img
    l = a & b
    markers[l] = i
  m=np.copy(markers)
  markers = markers.flatten()
  seeds={}
  for i in range(W*H):
    if markers[i] not in seeds:
      seeds[markers[i]]=[]
      seeds[markers[i]].append(i)
    else:
      seeds[markers[i]].append(i)
  return seeds,m,s

"""The peaks_dict is sorted in the descending order of the value of frequency so that we can choose the topmost when the segments are less than the length. 
This sorted peaks_dict is passed into seeds_dict function to return seeds, markers,segments.
"""

#function to return dictionary of seeeds, marker array(image) and the no. of segments used.
def get_markers(img,num_segments):
  peaks_dict = get_peaks(img)
  sorted_peaks_dict = sorted(peaks_dict.items(), key=operator.itemgetter(1), reverse=True)  
  seeds,markers,s = seeds_init( img,sorted_peaks_dict,num_segments)
  return seeds, markers,s

"""# Algorithm

* In random walker, every pixel of an image is assumed as a node of a graph and are connected with the neighbouring pixels with edges. 
* Some nodes are marked by the user and set to different class. (Our implementation does this automatically by using the intensities at peak positions and setting the markers for all those intensities lying within 0.01 of the intensity at peak, defined in `seeds_init` function.)
* After setting the markers or seeds, we now allocate class to the unmarked nodes/pixels.
* The set of nodes and edges are represented with a weighted undirected graph and the weight between two pixels is defined as:
![image.png](data:image/png;base64,)
where, gi and gj are the intensity values at the corresponding pixels.

* A Laplacian Matrix of dimension (W * H, W * H) is defined as:
![image.png](data:image/png;base64,)
where, di (degree) is the sum of all weights from the pixel i.
 
 * The Laplacian Matrix is broken into submatrices as:
 ![image.png](data:image/png;base64,)
Here, Lm = submatrix having relation between marked to marked,
      B  = submatrix having relation between marked to unmarked,
      BT = submatrix having relation between unmarked to marked,
      Lu = submatrix having relation between unmarked to unmarked.
* A matrix m(it shows whether a particular pixel belongs to a label/class or not) is defined as:
![image.png](data:image/png;base64,)
where, s is the label/class, j is a particular pixel, and Q is the label function to check whether the pixel is labelled that label or not.
* We calculate the probability(X for all class, xi shows probability in that class) of every unmarked pixel to attain a particular label. This is calculated using Lu,BT and M(m matrix for all class) matrices as:
![image.png](data:image/png;base64,)

* After getting the probability for every class, we label every unmarked pixel in the marker image according to the maximum probability across the classes.
* The image generated is the segmented image.
"""

#function to calculate weights 
def cal_weight(x,y,beta):
  arg = -(x-y)*(x-y)*beta
  return np.exp(arg)

directions = [1,-1,W,-W,W+1,W-1,-W+1,-W-1]

def isValid(x, y):
  if (x<0 or x>=H or y<0 or y>=W):
    return False
  return True
#function to return the laplacian matrix
def Laplacian(img_arr,beta):
  Lap_mat = np.zeros((W*H,W*H))
  for i in range(W*H):
    x1 = math.floor(i/W)
    y1 = (int)(i%W)
    sum = 0
    for d in directions:
      if(i > i+d):
        sum+= Lap_mat[i][i+d]
        continue
      x2 = math.floor((i+d)/W)
      y2 = (int)((i+d)%W)
      if(isValid(x2,y2) == False):
        continue
      Lap_mat[i][i+d] = Lap_mat[i+d][i] = -1 * cal_weight(img_arr[x1][y1], img_arr[x2][y2],beta)
      sum += Lap_mat[i][i+d]
    Lap_mat[i][i] = sum * -1
  return Lap_mat

#returns the ((inv)Lu*BT) from the laplacian submatrices as we only needs this, and
#the seeded array to calculate the M matrix
def Laplacian_submatrices(L,unmarked):
  A = np.arange(W*H)
  unseeded = np.array(unmarked)
  seeded = np.array(list(set(A)-set(unseeded)))
  temp = L[unseeded]
  BT = temp[:,seeded]
  LU = temp[:,unseeded]
  LUiBT = np.matmul(np.linalg.inv(LU),BT)
  return LUiBT,seeded

#returns the segmented image as per the algo defined above
def output_segmented(L,seeds_dict,s,markers):
  X = []
  M=[]
  LUiBT,seeded=Laplacian_submatrices(L,seeds_dict[0])
  l=len(seeded)
  for i in range(1,s+1):
    m=[0]*l
    for j in range(l):
      if seeded[j] in seeds_dict[i]:   
        m[j]=1
    M.append(m)
  M = np.array(M)
  for i in range(s):
    X.append(np.negative(np.matmul(LUiBT,M[i].T)))
  X = np.array(X)
  print(X)
  Y = X.argmax(axis=0)
  out = np.copy(markers)
  for i in range(len(seeds_dict[0])):
    ind = seeds_dict[0][i]
    out[math.floor(ind/W)][ind%W]=Y[i]+1
  return out

#function to call on any image to get the segmented image
def random_walker_myfunction(img, markers,seeds_dict,num_segments,beta):
  L = Laplacian(img,beta)
  result = output_segmented(L,seeds_dict,num_segments,markers)
  return result

#inbuilt rndom walker function
def random_walker_inbuilt(img,markers,beta):
  
  img = rescale_intensity(img, in_range=(np.min(img), np.max(img)),out_range=(0, 1))
  labels = random_walker(img, markers, beta, mode='bf')
  return labels

#calculate RMSE
def RMSE(y_actual, y_predicted):
  MSE = np.square(np.subtract(y_actual,y_predicted)).mean()
  return math.sqrt(MSE)

